import React from "react";
import { NavLink } from "react-router-dom";
import "./Navbar.css";
function Navbar() {
  return (
    <div className="navbar">
      <h1>ATT KS</h1>
      <nav>
        <NavLink to="/" activeClassName="active">
          Home
        </NavLink>
        <NavLink to="/ask" activeClassName="active">
          Ask Question
        </NavLink>
      </nav>
    </div>
  );
}

export default Navbar;
